import { useNavigate } from "react-router-dom";
import hotels from "../date/hotel";


const Navbar = () => {
  const navigate = useNavigate();

  const logout = () => {
    localStorage.removeItem("isAuth");
    navigate("/");
  };



  return (
    <nav className="navbar bg-white shadow-sm px-4 h-100 d-flex align-items-center">
      <span className="fw-bold">Dashboard</span>

      <div className="ms-auto d-flex align-items-center gap-3">
        <input className="form-control" placeholder="Recherche" />
        <span><i class="bi bi-bell"></i></span>

        <div className="border rounded-circle bg-danger p-2">
          <img src= {hotelimage} alt={image.nom}/>
        </div>

        <button className="btn btn-outline-none btn-sm"  onClick={logout}>
          <i class="bi bi-arrow-bar-right h5 p-2"></i>
        </button>
      </div>
    </nav>
  );
};

export default Navbar;
